void isku_rkp_free(IskuRkp *rkp) {
	if (rkp) {
		g_key_file_free(rkp->key_file);
		g_free(rkp);
	}
}

IskuRkp *isku_rkp_dup(IskuRkp const *src) {
	IskuRkp *dest = g_malloc0(sizeof(IskuRkp));
	guint i;

	dest->key_file = roccat_key_file_dup(src->key_file);
	dest->default_key_file = src->default_key_file;
	dest->modified_rkp = src->modified_rkp;
	dest->modified_light = src->modified_light;
	dest->modified_key_mask = src->modified_key_mask;
	for (i = 0; i < ISKU_KEY_INDEX_NUM; ++i)
		dest->modified_keys[i] = src->modified_keys[i];

	return dest;
}

IskuRkp *isku_rkp_read_with_path(gchar const *path, GKeyFile *default_key_file, GError **error) {
	IskuRkp *rkp = g_malloc0(sizeof(IskuRkp));
	rkp->key_file = g_key_file_new();
	rkp->default_key_file = default_key_file;

	if (!g_key_file_load_from_file(rkp->key_file, path, G_KEY_FILE_NONE, error)) {
		isku_rkp_free(rkp);
		return NULL;
	}

	return rkp;
}

gboolean isku_rkp_write_with_path(gchar const *path, IskuRkp *rkp, GError **error) {
	gchar *data;
	gsize size;
	gboolean ret;

	data = g_key_file_to_data(rkp->key_file, &size, error);
	if (!data)
		goto error;

	ret = roccat_profile_write_with_path(path, data, size, error);
	g_free(data);
	if (!ret)
		goto error;

	return TRUE;
error:
	g_warning(_("Could not write rkp %s: %s"), path, (*error)->message);
	return FALSE;
}

GKeyFile *isku_rkp_defaults(void) {
	static GKeyFile *values = NULL;
	GError *error = NULL;

	if (values == NULL) {
		values = g_key_file_new();
		if (!g_key_file_load_from_data(values, (gchar const *)default_rkp_data, sizeof(default_rkp_data), 0, &error)) {
			g_clear_pointer(&values, g_key_file_free);
			g_critical(_("Could not create default rkp: %s"), error->message);
			g_error_free(error);
		}
	}

	return values;
}

IskuRkp *isku_default_rkp(void) {
	IskuRkp *rkp = g_malloc0(sizeof(IskuRkp));
	rkp->key_file = roccat_key_file_dup(isku_rkp_defaults());
	rkp->default_key_file = isku_rkp_defaults();
	return rkp;
}
